  \"2015-07-08T19:17:15.495728\",\n\t\"name\": \"lims-nimbus-7-level-2-vertical-profiles-of-o3-no2-h2o-hno3-geopotential-height-and-tempera\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Limb Infrared Monitor of the Stratosphere
  (LIMS) version 6 Level-2 data product consists of daily, geolocated, vertical profiles
  of temperature, geopotential height, and mixing ratios of ozone (O3), nitrogen dioxide
  (NO2), water vapor (H2O), and nitric acid (HNO3). These data supersede the previous
  version 5 product, known as the LIMS Inverted Profile Archival Tape (LAIPAT). Version
  6 data have improved spatial resolution in both the vertical and along the orbital
  track, as well as improved accuracy and precision of measured geophysical parameters.
  The data files are in an ASCII text format and each data file is accompanied by
  three data screening files. The LIMS instrument was launched on the Nimbus-7 satellite
  and was operational from 25 October 1978 until May 28, 1979.nnParameters contained
  in the data files include the following:nVariable Name|Description|UnitsnO3|Ozone
  (O<sub>3</sub>) Volume Mixing Ratio|mol/molnNO2|Nitrogen Dioxide (NO<sub>2</sub>)
  Volume Mixing Ratio|mol/molnH2O|Water Vapor (H<sub>2</sub>O) Volume Mixing Ratio|mol/molnHNO3|Nitric
  Acid (HNO<sub>3</sub>) Volume Mixing Ratio|mol/molnT|Temperature Profile|KnGPH|Geopotential
  Height|mnEnd of parameter information\",\n\t\"license_title\": \"U.S. Government
